 Inn Stitches at Peralynna offers a tranquil setting for the enjoyment of all your favorite fiber arts - knitting crocheting spinning weaving embroidery and more. Relax and rewind in the beautiful Columbia Inn at Peralynna. Inn Stitches provides an encouraging and supportive atmosphere. Instructors from a wide range of fiber disciplines present retreat-like workshops. Regularly scheduled physical wellness seminars are targeted specifically to hand crafters needs.
Please note that in consideration of our guests with allergies The Inn maintains a smoke-free and fragrance-free environment.
&nbsp;
Peralynna Properties Inc&nbsp;&nbsp; dba&nbsp; The Columbia Inn at Peralynna
&nbsp;

