 This meetup group is dedicated to young&nbsp; people (ages 25-35) &nbsp;who are interested in fun and exciting activities around the DMV.
Join us for happy hours brunch live music festivals gallery parties pool tournaments karaoke pub crawls special events and so much more! So if you enjoy eating drinking browsing and generally enjoying all the fun things that happen in and around the DMV then this is the group for you!&nbsp;
Please note: This group is for everyone who enjoys life in the DMV! House Rules: We are not bothered about no-shows at large free events. If you RSVP but then can\xc2\x92t make it in the end no problem
- we understand these things happen. However: If you RSVP for small events with limited spaces and do not attend you will be subject to removal from group.&nbsp;

