 I'm trying to start up a novice meetup for adult men's lacrosse players in Baltimore. I'm 48 played baseball in college and am pretty lousy at lacrosse but have come to love the game.&nbsp;
Idea: Meet up at Patterson Park some other field or in the winter months indoors throw the ball around and build from there.&nbsp;
I will get t-shirts printed up (the organization will be sponsored thru my Fells Point church Holy Cross which is a good start for a lacrosse team name) to give it a semi-organized feel and get people geared up about being part of something.
&nbsp;Idea: Build to the point where we can play another beginner team. Also be active in community and do some things like stream cleanups etc (not mandatory) so this primarily an informal lacrosse toss around but if you're interested in doing some good you can. It will be the first of its kind. - TF

