 We are a social running group that welcomes people of all paces.&nbsp;
While Baltimore is known for its rats that scurry underneath we scurry over Roads And Trails --we are the Baltimore RAT Runners.&nbsp;
Our Monday runs start at 6:45 p.m. next to the Under Armour store on S. President St. (we are not associated with UA). We have options for 3-6 miles depending on your level.&nbsp;
Also if you drive and find parking difficult try the 1200 block of Bank Street for free street parking. &nbsp;Also the Little Italy Garage is inexpensive and safe. &nbsp;It's between Central Exeter and Bank streets.
&nbsp;Whether you live in Baltimore or are visiting feel free to join us.&nbsp;
Dan

