 - About&nbsp;
Skip that embarrassing one-on-one date and go out with a group that shares your good taste and interests. It\xe2\x80\x99s you and your friends + him and his friends.&nbsp;
- Why Group Dating
Because groups have more fun.
Blind dates are awkward. Traditional online dating? \xe2\x80\x93Creepy&nbsp;we know
Come to our meetup and we set you up with a group of daters for a fun and safe dating experience.
Our meetup is all about new people new places new ideas and new experiences. It\xe2\x80\x99s the safest way out of your comfort zone. Meet other groups find an interesting and compatible group of daters and go out in the city. Build friendships and your professional network and maybe even update your relationship status along the way.
&nbsp;- How It Works &nbsp;

We organize and coordinate group dating among our members.&nbsp;  Here are rules for a group formation:
&nbsp;- Minimum 2 and maximum 4 members per group is allowed.&nbsp; - All group members should be the same gender.&nbsp; - One member of group should be a Group Lead who manages the group activities.&nbsp; - A member can only be a part of one group.&nbsp;
 - When and Where to meet&nbsp;&nbsp;
We meet every Friday and Saturday evening.&nbsp;
&nbsp;- WEG2G Mobile App&nbsp; You can use WEG2G mobile App for tracking people you meet and your group activities. It is a free social site and mobile App.&nbsp;  Here are 5 quick steps for organizing your group meetup via our App:&nbsp; - Go to weg2g.com (or click&nbsp;here) and signup via Facebook&nbsp; - Add or invite connections&nbsp; - Make a group with your friends&nbsp; - Make or join a plan&nbsp; - Meet others in groups and have fun...
