Imagine a place you can go where you are warmly welcomed \xe2\x80\x93 where you meet other folks just like you looking for stress relief for real-ness in our relationships for comfort and peace in our busy world \xe2\x80\xa6 a practice.
Imagine owners&nbsp;Linda Miller brings her years of practice into every class and event passionately sharing all she's experienced and gratefully listening to your stories. She firmly believe in creating community where we learn from one another and bring joy to our lives. Just Imagine\xe2\x80\xa6
&nbsp;
Quiet Reiki Shares Meditation &amp; Low cost Yoga are just a few of our many offerings.&nbsp; Join us for a gathering soon we look forward to meeting you! Visit www.imaginetheplace.com for more information.
&nbsp;
