 Bringing people with a variety of ideologies and perspectives together for&nbsp;friendly polite discussion of global international national and local trends events and politics.
We encourage people to give their honest opinions given that they are able to substantiate them. &nbsp;Many topics may not be politically-correct but anyone with a sincere interest in current events history geopolitics or philosophy should join*!

*Read: &nbsp;If you genuinely plan to attend our meetups. &nbsp;Members will be removed after 3 months inactivity.&nbsp;

 This is a group for entrepreneurs solopreneurs and small businesses who want to discover their authentic brand and be able to talk about it it in a compelling way.&nbsp;
I'd love to have coffee with everybody and this is a way for me to meet you connect for an hour and for you to meet other entrepreneurs.&nbsp;
We're a tribe that brainstorms learns from each other and does it while having fun and eating killer homemade Pop Tarts at my favorite clubhouse the Iron Rooster.&nbsp; 
The purpose of this Meetup is NOT for networking or selling your stuff although that may happen organically.&nbsp;
Who You Are:&nbsp;
You love what you do maybe wish you were doing it better are tired of beating around the bush when you talk about it and want more clarity about what your brand is so you can live well and prosper.&nbsp;
Who We Are:&nbsp;
We're a tribe that supports each other brainstorms together learns a lot from each other and does it while having fun and eating the killer homemade Pop Tarts at my favorite clubhouse the Iron Rooster.&nbsp;
Come hang out for an hour and talk about branding marketing and all things entrepreneurial!

 I am thrilled to be taking over Annapolis Brew Crew from Courtney (see below).&nbsp; Without all of her hard work to get this group up and running I wouldn\xe2\x80\x99t have had the opportunity to step in for her when her work got too busy. 
I\xe2\x80\x99m going to start this off slowly as I get my organizer feet under me.&nbsp; Initially I\xe2\x80\x99ll schedule a number of happy hours to get more acquainted with you the members.&nbsp; Beer festivals and brewery tours will be added shortly after. 
I hope that with your participation we can make this a fun and possibly even an educational meetup group.&nbsp; Welcome fellow ABCers! 
- Gregg &lt;br&gt; 
&lt;br&gt; 
More About this Meetup 
From the original organizer Courtney: 
This is a group for fun people in the Annapolis area who appreciate craft beer. We'll gather at establishments featuring great beer lists go on local brewery tours and maybe even catch a beer festival or two. 
I started this group because I genuinely enjoy a tasty craft beer and I want to seek out where to get the best brews in the Annapolis vicinity while making new friends. 
All levels of craft beer enthusiasts are welcome but beer snobs are not! You don't have to memorize fancy beer lingo know if "Shake Your Money Maker" is a song or a beer or be able to sing "99 Bottles of&nbsp;Beer" in tune. But you do have to be 21 and mind your Ps and Qs.&nbsp; 
A few notes about this meetup group are below.&nbsp; Any questions or comments you have about this group are always welcome.&nbsp; Thank you for taking the time to check out Annapolis Brew Crew. Cheers Courtney 
Genesis of Annapolis Brew Crew:&nbsp; Annapolis Brew Crew is version 2.0 of a \xe2\x80\x9cBrew Crew\xe2\x80\x9d group I had in San Diego.&nbsp; As San Diego is one of the hottest spots in the country for craft beer there were about 20 breweries including big ones like Stone within about seven miles of where I lived and worked.&nbsp; The intent of my San Diego Brew Crew was to visit a new brewery the first Thursday of each month after work.&nbsp; Overtime people wanted to join my crew but didn\xe2\x80\x99t like beer so we often deviated from the breweries and went to local bars that had spirits and wine.&nbsp; Basically Brew Crew evolved into a happy hour group.&nbsp; Now that I have moved cross country I am starting a new Brew Crew but do plan to keep this one focused on beer.&nbsp; 
Limited Membership: Initially Annapolis Brew Crew will be limited to 50 members but should this group continue to flourish I will pay additional dues to Meetup.com to expand our membership base.&nbsp; The reason for this is simply because Meetup has gotten expensive and charges the organizer based on the number of members it has.&nbsp; I don\xe2\x80\x99t mind paying for additional members as long as they are actively engaged in Annapolis Brew Crew so I will monitor this situation closely as our meetup group matures.&nbsp; Members who have not recently been active on the Annapolis Brew Crew site may be removed; however if you are still interested in this Meetup please feel free to rejoin as we\xe2\x80\x99d love to see you at a future event.&nbsp;

 SHIFTandGO Ride Events is an independent open-invite motorcycle group for riders who want to ride more than anything else. &nbsp;Based out of Maryland we are Riders and RideSeekers who create organize and lead to inspire others to do more see more get more out of their riding experience.&nbsp; Our mission is to provide the best street motorcycle riding experience outside of racing.&nbsp; We offers new and exciting monthly group riding options throughout the country for those who prefer twisty back roads and unique destinations to collect both miles and memories.&nbsp; Each riding season from April to October we provide over 20 different half-day and full-day scheduled meet-up rides and up to six (6) city tour events to satisfy all types of riding and riding experiences.&nbsp;
http://www.youtube.com/embed/KUj5wiSowDE
SHIFTandGO Ride Events doesn't compete or replace Club Group Team or Solo Riding-Life it adds to it with new ride options open to all. &nbsp;Riders choose the type of ride you want to experience RSVP + guest(s) and allow us to lead the way. &nbsp;For more information about SHIFTandGO the RIDESEEKERS TOUR or upcoming scheduled rides in your area visit www.SHIFTandGO.com Like us on Facebook and see our schedule on www.Meetup.com/SHIFTandGO.&nbsp;
https://youtu.be/ZIgpS2fLUs0
Want more SHIFTandGO? &nbsp;Subscribe to us on YouTube. &nbsp; Stay Up Stay Out There and Thank You...CLUTCH aka Clutch-Time.

