 This is a group for people who want to have a pleasant walk or hike. There are three rules: 1) We walk at a moderate pace slow enough to see the scenery and to chat but not so slow we are not getting exercise and keeping a good pace. 2) We leave no one behind. 3) We stop as a whole group every so often to catch our breath. We will not have a group of fast walkers stop and rest and as soon as the slow walkers catch up they take off leaving the slower group never catching a break!&nbsp;
Please let us know if you are coming on a walk/hike but if you can't make it don't worry about saying that you are not coming! If you change your mind change your RSVP.

Looking forward to a great group of folks to walk/hike with!&nbsp;

Pat

