 Welcome to the meetup where you can connect with other fashionista thrifters who shares the same love of vintage recycled and gently used clothing apparel and shoes! Looking to hang out and find the best flea markets in the suburbs and metro area of the city including metropolitan Washington D.C.&nbsp;
This group is for the ladies who are not afraid to hit up yard sales flea market thrift stores and estates sales during the weekend!&nbsp; We'd love to meet up with you for 'the real connection' and attend flea markets yard sales etc and make the most of flea market shopping at its best. &nbsp;Do you know the best flea markets in the city? &nbsp;Tell us join us Let's all meetup!
Highly recommended for the those interested in connecting collaborating and conversing about vintage buys fashion finds gently-used fashion truck shopping vintage clothing recycled clothing hats fedoras accessories unique finds shopping repurposed home decor recycled furniture thrifting; estate sales and antiques.&nbsp;
Join us as we meet up to explore the thrifting side of the city attend themed events enjoy outdoor activities hit up Fashionista Flea Market events and vintage shopping. Join us on the flea market journey! Welcome Fashionistas Who Love Flea Market Shopping Meet Up Group!

 The meetup group is Tom Thumb Square Dance Club and it is for those who want to socialize and exercise at the same time make new friends and just have fun!!!!! There is a slogan we dancers use: While dancing in a square you make a circle of friends! Dancers must be at least 18 years of age couples singles and families are welcome to attend square dance lessons hosted by the club and children are allowed if accompanied by an adult.&nbsp; Lessons usually start in early September (14th of September) and are held at the Catonsville Senior Center. Beginner dances are held every 6-8 weeks during the time a new dancers is learning to dance. For information call 301-919-2525 or e-mail your request to roslyn.powers@gmail.com. Square Dancing is lead by a caller and all in the square work together to dance to the caller's choreography. Square dancing is a team sport and once you learn the calls you can dance anywhere USP Europe China et cetera. Square Dance Calls are a universal language.

The club dances every first and third Friday of the month. We dance at the Hollifield Station Elementary&nbsp; School in Ellicott City MD.

Come watch us dance!! &nbsp;We will be hosting a square dance demo at the Howard County Fair. Demo is at 5pm at the Entertainment Stage on Saturday August 8th and a beginner's dance is at 7pm in the 4H Activities Hall.&nbsp;
